import React from "react";

const Player = ({prop}) => {
    console.log(prop);
    return(
        <div className="playerContainer">
            <div className="playerLeftContainer">
                <img src={prop.image} alt=""/>
                <p></p>
            </div>
            <div className="playerRightContainer"></div>
        </div>
    )
}
export default Player;
